const input = $input.first().json.data; // exemplo: "14/05"

const [diaStr, mesStr] = input.split('/');
const dia = parseInt(diaStr, 10);
const mes = parseInt(mesStr, 10) - 1; // JavaScript usa mês de 0 a 11

const ano = new Date().getFullYear(); // ou defina manualmente se necessário

const data = new Date(ano, mes, dia);

// Encontrar o primeiro domingo anterior ou igual ao primeiro dia do mês
const primeiroDiaDoMes = new Date(ano, mes, 1);
const diaDaSemana = primeiroDiaDoMes.getDay(); // 0 = domingo, 1 = segunda...

const primeiroDomingo = new Date(primeiroDiaDoMes);
primeiroDomingo.setDate(primeiroDiaDoMes.getDate() - diaDaSemana);

// Calcular a diferença de semanas
const diffEmDias = Math.floor((data - primeiroDomingo) / (1000 * 60 * 60 * 24));
const semanaDoMes = Math.floor(diffEmDias / 7) + 1;

return {
  semana: semanaDoMes
};
